![medium](https://www.gstatic.com/codereviewagent/medium-priority.svg)

この権限チェックのロジックは、`getCategories`や`addCategory`メソッドにも存在し、コードが重複しています。保守性を高めるために、このロジックをプライベートメソッドに切り出すことを検討してください。例えば、以下のような`checkAdmin`メソッドを作成し、各メソッドの冒頭で呼び出すようにリファクタリングできます。

```java
private void checkAdmin(UserDetails userDetails) {
    String loginId = userDetails.getUsername();
    User user = userRepository.findByLoginId(loginId)
            .orElseThrow(() -> new org.springframework.security.core.userdetails.UsernameNotFoundException("User not found with loginId: " + loginId));
    if (!user.getRole().equals(Role.ROLE_ADMIN)) {
        throw new AccessDeniedException("権限がありません");
    }
}
```

このリファクタリングにより、`loginId == null`という冗長なチェックも不要になり、`RuntimeException`の代わりに`UsernameNotFoundException`のような具体的な例外を使用できます。

